const dataUrl= ``;



const sharp= require('sharp');
const fs = require('fs');
const func= async()=>{
    const buffer= Buffer.from(dataUrl, 'base64');
    // save the image as jpeg file
    const res=  await sharp(buffer).resize(1080, 1080).toBuffer();
    // save the image as jpeg file
    fs.writeFileSync('test.jpg', res);
}

func();